import React from 'react';

function LoginModal({ isVisible, onClose }) {
  if (!isVisible) return null;

  return (
    <div className="modal">
      <button onClick={onClose}>Close</button>
      <form>
        {/* Login form fields */}
        <button type="submit">Log In</button>
      </form>
    </div>
  );
}

export default LoginModal;
